import React, { Component } from "react";
import "./Cards.css";

class Cards extends Component {
  render() {
    return (
      <div className="card-box ">
        <div className="card-img">
          <img src="" alt="card-img" />
        </div>
        <div className="card-title">
          <div className="pro-pic">
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e4/Small-city-symbol.svg/893px-Small-city-symbol.svg.png"
              alt="profile-pic"
            />
          </div>
          <div className="pro-title">
            <h1>Sehbaz</h1>
            <p>Web Developer</p>
          </div>
        </div>
        <div className="pro-details">
          <p>
            Hello Worlds<br>Sehbsx</br>
            <br>Sfas</br>
          </p>
        </div>
      </div>
    );
  }
}
export default Cards;
